import { BrowserRouter as Router, Route } from "react-router-dom";
import { NavLink } from "react-router-dom";
import Action from "../Components/Action";
import Modals from "../Components/Modals";
import Card from "../Components/Card";
import React, { useState, useEffect } from "react";

const Dashboard = () => {
  const [products, setProducts] = useState();
  // using a componentDidMount here to retrieve my products from my endpoint

  useEffect(() => {
    axios
      .get("/api/Products")
      .then(({ data }) => {
        console.log(data);
        setProducts(data);
      })
      .catch(function(error) {
        // handle error
        console.log(error);
      });
  }, []);
  return (
    <Router>
      <Action />
      <section id="posts">
        <div className="container">
          <div className="row">
            <div className="col-md-9">
              <div className="card">
                <div className="card-header">
                  <h4>Latest Updates</h4>
                </div>
                <table className="table table-striped">
                  <thead className="thead-dark">
                    <tr>
                      <th>#</th>
                      <th>Product Name</th>
                      <th>Price</th>
                      <th>Category</th>
                      <th>Date</th>
                      <th />
                    </tr>
                  </thead>
                  <tbody>
                    <div className="flex-items">
                      {products &&
                        products.map(product => (
                          <Card
                            key={product.productName}
                            name={product.productName}
                            category={product.category}
                            description={product.productDescription}
                          />
                        ))}
                    </div>
                    <NavLink className="btn btn-secondary" to="/details">
                      <i className="fas fa-angle-double-right" /> Details
                    </NavLink>
                  </tbody>
                </table>
              </div>
            </div>
            <div className="col-md-3">
              <div className="card text-center bg-primary text-white mb-3">
                <div className="card-body">
                  <h3>Products</h3>
                  <h4 className="display-4">
                    <i className="fas fa-pencil-alt" /> 6
                  </h4>
                  <NavLink
                    className="btn btn-outline-light btn-sm"
                    to="/products"
                  >
                    View
                  </NavLink>
                </div>
              </div>
              <div className="card text-center bg-warning text-white mb-3">
                <div className="card-body">
                  <h3>Users</h3>
                  <h4 className="display-4">
                    <i className="fas fa-users" /> 4
                  </h4>
                  <NavLink className="btn btn-outline-light btn-sm" to="/users">
                    View
                  </NavLink>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
      <Modals />
    </Router>
  );
};

export default Dashboard;
